import React from 'react'
import { nanoid } from 'nanoid'

export default function GetFinishButton(props){
    const styles = {backgroundColor : props.correct ?  ' green' : props.isheld && props.value === false ? 'red' :'rgb(221, 224, 238)'}
    return <button style={styles} className='main-btn' disabled key={nanoid()}>{props.value}</button>
}
